const reservation = {
    id: 1,
    roomId: 1,
    userId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
}

const user = {
    id: reservation.id,
    roomId: reservation.roomId,
    start: reservation.start,
    end: reservation.end
}

const admin = {
    id: reservation.id,
    roomId: reservation.roomId,
    userId: reservation.userId,
    start: reservation.start,
    end: reservation.end
}
export default{
    user, admin
}
